  path:'addch',component: AddChambreComponent
},
{
  path:'allch',component: ShowChambreComponent
},
{path:'detailCh/:idChambre',component: DetailChambreComponent},
{path:'updateCh/:idChambre',component: UpdateChambreComponent},];

